import "./RatingCard.css";
const RatingCard = () => {
  return (
    <div className="group-parent26">
      <div className="container">
        <div className="div3">4.7</div>
        <img className="mask-group-icon3" alt="" src="/undefined115.png" />
        <div className="based-on-100000">Based on 100000+ Reviews</div>
      </div>
      <div className="group-child19" />
      <div className="parent1">
        <div className="div4">2,50,000</div>
        <div className="happy-customers">Happy Customers</div>
        <img className="mask-group-icon4" alt="" src="/undefined116.png" />
      </div>
    </div>
  );
};

export default RatingCard;
